import "./App.css";
import LandingPage from "./Pages/landing-page.jsx";
import { Route, Routes} from 'react-router-dom';

function App() {
    return (
        <div className="App">
                    <Routes>
                        <Route exact path ="/" element = {<LandingPage />} />
                    </Routes>
        </div>
    );
}

export default App;
